const { render } = require("@testing-library/react");

function NavBar() {
    const items = [{name: "Home", id: "Body"}, 
                    {name: "Education", id: "Education"}, 
                    {name: "Experience", id: "Experience"}, 
                    {name: "Projects", id: "Projects"}];

    const [hover, setHover] = useState(false);
    return (
        <div>
            <ul id = "nav" style={navCSS}>
                {items.map(item => (
                    <li key={item, index}>
                        <a href={'#'+item.id} style={navItemCSS}>{item.name}</a>
                    </li>
                ))}
            </ul>
        </div>
    )
}

const navCSS = {
    width: "100%",
    margin: "0 0 0 0",
    display: "flex",
    flexDirection: "row",
    listStyle: "none",
    backgroundColor: "white"
}

const navItemCSS = {
    display: "block",
    padding: "4px 8px",
    margin: "10px",
    fontSize: "20px",
    textDecoration: "none",
    color: "#0b4fba" 
}

export default NavBar;
